import React from 'react';
import { Switch, Route } from 'react-router';
// import { BooksDisplay } from './BooksDisplay';
import { NumberTableBuilder } from './NumberTableBuilder';

export class MultiRoute extends React.Component<any, any> {
  // in here we'll make use of some router props
  render() {
    return (
      <>
      <h4>match: {JSON.stringify(this.props.match)}</h4>
      <h4>location: {JSON.stringify(this.props.location)}</h4>
      <h4>history: {JSON.stringify(this.props.history)}</h4>
      {/* Nested routing: */}
      <Switch>
        {/* <Route path={`${this.props.match.path}/first`} component={BooksDisplay} /> */}
        <Route path={`${this.props.match.path}/second`} component={NumberTableBuilder} />
      </Switch>
      </>
    )
  }
}
